import React from 'react';
import Card from './Card';

function CardList({ pets }) {
	const petsArray = pets.map((pet, i) => {
		return <Card id={pets[i].id} img={pets[i].img} name={pets[i].name} description={pets[i].description}/>
	})
	return (
		<div>
			{petsArray}
		</div>
	);
}

export default CardList;
